import React, { useState } from 'react';

const TiktokOrgPost = (props) => {

  const [isOpen, setIsOpen] = useState(false);


  return (
    <div className='tiktok_org_post_wrapper'>
        <button onClick={() => setIsOpen(!isOpen)}>Toggle Post</button>

        <h3>Title: {props.title}</h3>
        <p>Audio name: {props.audio}</p>
        <p>Script: {props.script}</p>
    </div>
  )
}

export default TiktokOrgPost
